var database = [];
var scroller = {
    _list: null,
    _element: null,
    _config: {
        // All items must be the exact same height currently. Although since there is
        // a generate method, in the future this should be configurable.
        width: "100%",
        height: "520px",
        itemHeight: 38,

        // Specify the total amount of items to render the virtual height.
        total: 1,

        // Wire up the data to the index. The index is then mapped to a Y position
        // in the container.
        generatew(index) {
            const el = document.createElement("div");
            el.innerHTML = `ITEM ${index + 1}`;
            return el;
        },
        generate(index) {
            if (!document.filteredDatabase) {
                return document.createElement("div");
            }
            const el = document.createElement("div");
            const entry =
                document.filteredDatabase[
                    index > document.filteredDatabase.length
                        ? document.filteredDatabase.length - 1
                        : index
                ];
            if (!entry) {
                return document.createElement("div");
            }
            let year = entry.year;
            if (year == "19xx") {
                year = `<span class="blur">${year}</span>`;
            }
            let pouet = "";
            if (entry.pouet_id) {
                pouet = `<a title="pouet" class="info" href="https://www.pouet.net/prod.php?which=${entry.pouet_id}" onclick="event.stopPropagation()" target="_blank">&#127327</a>`;
            }
            let text = `${
                entry.title
            } <a title="demozoo" class="info" href="https://demozoo.org/productions/${
                entry.id
            }" onclick="event.stopPropagation()" target="_blank">&#127315</a>
					${pouet} <a title="Insert disk, NO reset" class="info disk" onclick="document.insertDiskOnly(this,event)" target="_blank">&#x1F4BE</a> (${year} - ${
                entry.type
            } - ${
                entry.groups
            }) <small>${entry.fileName.toLowerCase()}</small>`;
            const filterTexts = document
                .getElementById("filter")
                .value.split(" ");
            if (filterTexts[0].trim().length > 0) {
                for (filterText of filterTexts) {
                    if (filterText.trim() != "") {
                        //negative lookbehind/ahead of < resp > and snitize input for regex use
                        const t =
                            "(" +
                            filterText.replace(/[.?*+\\|{()[^$]/g, "\\$&") +
                            "(?!([^<]*>)))";
                        const re = new RegExp(t, "gi");
                        text = text.replace(re, `<u>${filterText}</u>`);
                    }
                }
            }
            if (entry.tags) {
                for (tag of entry.tags) {
                    text += `<span class="tag" onclick="document.filtertag(this,event)">${tag}</span>`;
                }
            }
            el.innerHTML = text; //`ITEM ${index + 1}`;
            el.setAttribute("data-url", entry.parameter);
            el.setAttribute("data-url-type", entry.link_class);
            el.setAttribute("data-url-id", entry.link_id);
            el.setAttribute("data-id", entry.id);
            el.classList.add("no-wrap");
            el.classList.add("list-toggle" + (index & 1).toString());

            el.onclick = document.onDemoClick;
            return el;
        },
    },
    init: () => {
        // scroller._element = document.getElementById("innerSelector");
        // scroller._list = new HyperList(scroller._element, scroller._config);
    },
    update: (count) => {
        if (scroller._list && 1 == 1) {
            scroller._config.total = count;
            scroller._list.refresh(scroller._element, scroller._config);
        }
    },
    destroy: () => {
        if (scroller._list && 1 == 1) {
            scroller._list.destroy();
            scroller._list = null;
            document.getElementById("innerSelector").innerHTML = "";
        }
    },
};

